import React from 'react';
import { type Sketch, type P5CanvasInstance } from '@p5-wrapper/react';
import { NextReactP5Wrapper } from '@p5-wrapper/next';
import {
  Settings,
  calculateDimensions,
  createPoints,
  draw,
  setup,
} from '@/lib/logo/main';
import { Particle } from '@/lib/logo/particle';

const sketch: Sketch = (p5: P5CanvasInstance) => {
  // Handle light/dark mode
  // Note: using `window` should be safe here as the P5 wrapper guarantees
  // `window` is defined.
  let backgroundColour = '#ffffff';
  if (
    window.matchMedia &&
    window.matchMedia('(prefers-color-scheme: dark)').matches
  ) {
    backgroundColour = '#09090b';
  }

  const settings: Settings = {
    backgroundColour,
    fadeRate: 30,
    hueInc: 0.025,
    minMaxSpeed: 1.5,
    maxMaxSpeed: 2.25,
    minStrokeWeight: 0.75,
    maxStrokeWeight: 1.5,
    particleCount: 1000,
    perlinScale: 0.0375,
    polarityThreshold: 0.5,
    scl: 15,
  };
  const dimensions = calculateDimensions(settings, 1024, 280);
  const points = createPoints(p5, settings, dimensions);
  const particles: Particle[] = [];
  let counter = 0;
  let zoff = 0;

  p5.setup = () => setup(p5, settings, particles, dimensions);
  p5.draw = () =>
    ([counter, zoff] = draw(
      p5,
      settings,
      points,
      particles,
      dimensions,
      counter,
      zoff
    ));
};

export const AnimatedLogo = () => {
  return (
    <div className="w-full">
      {/* Mobile logo */}
      <div className="md:hidden text-center">
        <h1 className="text-slate-900 font-extrabold text-4xl sm:text-5xl lg:text-6xl tracking-tight text-center dark:text-white">
          Build, deploy and scale code
          <br />
          with <em>zero</em> infrastructure.
        </h1>
      </div>

      {/* Desktop animated logo */}
      <div className="hidden md:block relative my-20 mx-auto text-white dark:text-zinc-950 w-full">
        <LogoMaskSvg />
        <NextReactP5Wrapper sketch={sketch} />
      </div>
    </div>
  );
};

